import React from 'react';

class Footer extends React.Component {
  render() {
    return (
      <div>
        <footer className="page-footer font-small bg-secondary">
          <div className="footer-copyright text-center py-3 text-white">
            Copyright Footer
          </div>
        </footer>
      </div>
    );
  }
}

export default Footer;
